import React, { Component } from 'react';
import {Link, NavLink} from 'react-router-dom';
import './product.css';
import Cart from './cart';

const Product = (props) => {
    return(
        <React.Fragment>
           <div className="body">
                <div className="container"> 
                    <h1 className="products text-center">Our Products</h1>
                    <table className="table">
                        <tbody>
                            {props.products.map(product => (
                            <tr key={product.id}>
                                <td><img src={product.photo} alt="" width="100" height="100"/>
                                </td>
                                    <td>{product.name}</td>
                                    <td>{product.price}</td>
                                    <td>
                                    <Cart onClick={props.onClick} product={product} />
                                </td>
                            </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </React.Fragment>
    );
}
 
export default Product;
